import React from "react";
import { loadFireBase } from "../lib/database";

const Cards = ({ title, start_time, end_time, Description }) => {
  return (
    <div>
      <img src="" alt="" />
      <h4>{title}</h4>
      <hr />
      <h6>
        {start_time} - {end_time}
      </h6>
      <h6>Date</h6>
      <p></p>
      <p>{Description}</p>
    </div>
  );
};

export default Cards;
